// NotFound.js
import React from 'react';

const NotFound = () => {
  return (
    <div className='not-found'>
      <div className="container">
      <h3>404 - Page Not Found</h3>
      <p>The page you are looking for does not exist.</p>
      </div>
    </div>
  );
}

export default NotFound;
